import org.junit.jupiter.api.BeforeEach;import org.junit.jupiter.api.Test;import static org.assertj.core.api.AssertionsForClassTypes.assertThat;public class TraybakeTest {    Traybake traybake;    @BeforeEach    void setUp() {        traybake = new Traybake("chocolate", "brownie", 8, "square", "chocolate goo");    }    @Test    void canHaveIcing() {        assertThat(traybake.hasIcing()).isEqualTo("Yum, icing!!");    }    @Test    void canHaveSprinkes() {        assertThat(traybake.hasSprinkles()).isEqualTo("I love sprinkles!");    }    @Test    void canBeVegan() {        assertThat(traybake.isVegan()).isEqualTo("I wish this was vegan");    }    @Test    void canHaveFilling()    {        assertThat(traybake.hasFilling()).isEqualTo("This traybake has a filling of chocolate goo");    }}